asas/controller.html.body:
Controller
Struktur code untuk aplikasi web sama sahaja seperti yang kita lihat di
tutorial database. Cuma satu yang saya tidak beritahu dalam
tutorial tersebut ialah controller. Dalam tutorial database, controller untuk
code tersebut ialah di bahagian pengambilan input. Maksudnya, controller ialah
bahagian code yang mengawal interaksi dengan pengguna.
Sekarang kita cuba membuat controller untuk memaparkan Hello, World! di
browser. Create class baru dengan nama GreetingController dengan kandungan
berikut:
package com.jombelajarjava.hello;

import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.RestController;

@RestController
public class GreetingController {
    @GetMapping("/")
    public String greeting() {
        return "Hello, World!";
    }
}

Setelah update server, refresh browser dan kita boleh melihat Hello, World!
terpapar di skrin.

Sekarang kita cuba sesuatu yang lain sedikit. Kita akan menghantar code HTML ke
browser. Tukar baris,
return "Hello, World!";

ke
return "Hello, World!";

Setelah update, refresh browser dan kita boleh nampak tulisan Hello, World!
menjadi besar. Jadi, itulah web development secara keseluruhannya, tiada
istimewanya berbanding aplikasi console, cuma perlu memanipulasi string ke
format yang difahami oleh browser.

asas/routing.html.body:
Routing
Routing berasal daripada perkataan route yang bermaksud laluan. Routing dalam
aplikasi web bermaksud laluan untuk menggunakan fungsi yang mana. Routing
ditentukan dalam controller menggunakan,

request path, contohnya /, /documentation
HTTP method, contohnya GET dan POST

Dalam tutorial yang lepas, kita ada membuat route GET ke path / menggunakan
annotation @GetMapping("/"). Kita boleh menambah route yang lain pada
controller, contohnya,
@RestController
public class GreetingController {
    @GetMapping("/")
    public String greeting() {
        return "Hello, World!";
    }

    @GetMapping("/nama")
    public String name() {
        return "Nama saya ialah...";
    }
}

Kita boleh pergi ke localhost:8080/nama untuk pergi ke route tersebut.
Untuk membuat route yang menggunakan HTTP method POST, kita boleh menggunakan
annotation @PostMapping, contohnya,
@RestController
public class GreetingController {
    ...

    @GetMapping("/nama")
    public String name() {
        return "Nama saya ialah...";
    }

    @PostMapping("/nama")
    public String postName() {
        return "Post nama";
    }
}

Path tersebut boleh sama dengan path yang lain.
Apabila kita menggunakan browser untuk membuka sesuatu link, kita sebenarnya
membuat request GET ke server. Untuk membuat request POST, kita boleh
menggunakan mana-mana REST client. Contoh yang saya guna ialah
RESTClient. Anda
boleh mencari REST client di internet, kebanyakannya percuma.
Dengan menggunakan REST client, kita boleh mendapatkan response daripada server
bergantung kepada request method yang kita gunakan.

asas/request.html.body:
Request
Request ialah segala maklumat yang datang daripada pengguna seperti browser
mana, link apa, dan HTTP method mana yang digunakan.
Path variable
Kita boleh mendapatkan maklumat mengenai link menggunakan annotation
@PathVariable. Contoh,
    @GetMapping("/page/{pageNo}")
    public String greeting(@PathVariable int pageNo) {
        return "Sekarang kita berada di muka surat " + pageNo;
    }

Pergi ke localhost:8080/page/10 di browser untuk melihat hasilnya.
Request parameter
Request parameter adalah salah satu cara untuk mengambil input daripada
pengguna. Annotation yang perlu digunakan ialah @RequestParam. Contoh,
    @GetMapping("/nama")
    public String name(@RequestParam String name) {
        return "Nama saya ialah " + name;
    }

Sekarang route tersebut memerlukan parameter daripada pengguna. Contoh untuk
menghantar request parameter adalah dengan menaip di browser seperti berikut:
localhost:8080/nama?name=Muhammad Ali
Kemudian server akan menjawab,
Nama saya ialah Muhammad Ali
Request parameter adalah wajib. Jika anda tidak mahu mewajibkan request
parameter, anda boleh menetapkan annotation seperti berikut,
    @GetMapping("/nama")
    public String name(
            @RequestParam(
                    required = false,
                    defaultValue = "hmm, lupa") String name) {
        return "Nama saya ialah " + name;
    }

Request body
Kedua-dua cara di atas akan mendedahkan segala data yang dihantar oleh pengguna.
Cara tersebut tidak sesuai digunakan untuk maklumat yang sensitif seperti
password. Untuk itu, kita boleh menggunakan request body.
Sebelum mengambil request body, kita perlu mempunyai class yang menetapkan
bentuk data tersebut. Kita akan membuat class User sebagai contoh,
public class User {
    private String name;
    private String location;

    public User() {}

    public User(String name, String location) {
        this.name = name;
        this.location = location;
    }

    public String getName() {
        return name;
    }

    public void setName(String name) {
        this.name = name;
    }

    public String getLocation() {
        return location;
    }

    public void setLocation(String location) {
        this.location = location;
    }
}

Untuk mengambil request body, kita perlu menggunakan annotation @RequestBody
seperti berikut,
    @PostMapping("/")
    public String greeting(@RequestBody User user) {
        return "Selamat datang, " + user.getName() +
                ", dari " + user.getLocation() + "!";
    }

Request body biasanya dihantar melalui method POST. Jadi, kita perlu
menggunakan REST client untuk test code tersebut.

asas/response.html.body:
Response
Response ialah maklumat yang kita ingin pulangkan kepada pengguna seperti jenis,
status dan kandungan response tersebut.
Jenis Response
Dalam Spring Boot, jenis response bergantung kepada jenis data yang kita return.
Jika kita return String, kita akan memberi response dalam bentuk HTML secara
default.
    @GetMapping("/")
    public String greeting() {
        return "Hello, World!";
    }

Jika kita return object, kita akan memberi response dalam bentuk JSON.
@RestController
public class GreetingController {
    @GetMapping("/")
    public Message greeting() {
        return new Message("Hello, World!");
    }

    class Message {
        private String message;

        Message(String message) {
            this.message = message;
        }

        public String getMessage() {
            return message;
        }
    }
}


Format JSON selalu digunakan untuk komunikasi antara aplikasi. Contohnya
Android, server yang lain, atau single-page application.
Jika kita ingin menetapkan jenis response secara manual, kita boleh meletakkan
di parameter annotation seperti berikut:
@RestController
public class GreetingController {
    @GetMapping(path = "/", produces = MediaType.TEXT_PLAIN_VALUE)
    public String greeting() {
        return "Hello, World!";
    }
}

asas/autowire.html.body:
Autowire
Spring pada asalnya adalah merupakan dependency injection framework. Kemudian,
semakin lama, semakin berkembang sehingga menjadi web framework. Jika anda
perasan, selama ini kita hanya menambah annotation @RestController untuk
menjadikan class tersebut sebuah controller. Kita tidak membina object
menggunakan new pun untuk controller tersebut.
Sekarang kita akan melihat bagaimana untuk membuat dependency injection
menggunakan Spring.
@Repository
Annotation @Repository boleh digunakan untuk class DAO, iaitu class yang
mengandungi operasi database. Untuk demo tutorial ini, kita akan membuat class
untuk memilih bahasa berdasarkan pengguna, seperti berikut,
package com.jombelajarjava.hello;

import org.springframework.stereotype.Repository;

@Repository
public class LanguageRepository {
    public String getUserLanguage(String name) {
        switch (name) {
            case "Muhammad Ali": return "ms";
            case "Kamen Rider": return "ja";
            default: return "en";
        }
    }
}

Dalam situasi sebenar, class tersebut akan mendapatkan data daripada database.
@Service
Annotation @Service, seperti namanya, boleh digunakan untuk class service.
Untuk demo, kita akan membuat class yang akan memilih greeting mengikut bahasa.
package com.jombelajarjava.hello;

import org.springframework.stereotype.Service;

@Service
public class GreetingService {
    private LanguageRepository languageRepository;

    public String getGreeting(String name) {
        String language = languageRepository.getUserLanguage(name);

        switch (language) {
            case "ms": return "Selamat datang, " + name + "!";
            case "ja": return "Irasshaimase, " + name + "!";
            default: return "Welcome, " + name + "!";
        }
    }
}

@Autowired
@Autowired ialah annotation untuk membuat dependency injection menggunakan
Spring Boot, sama seperti @Inject jika menggunakan framework yang lain.
Disebabkan class GreetingService di atas memerlukan LanguageRepository, maka
kita akan menggunakan @Autowired di situ.
package com.jombelajarjava.hello;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Service;

@Service
public class GreetingService {
    private LanguageRepository languageRepository;

    @Autowired
    public GreetingService(LanguageRepository languageRepository) {
        this.languageRepository = languageRepository;
    }

    ...
}

Setelah selesai, kita boleh menggunakan service dalam controller, seperti
berikut,
package com.jombelajarjava.hello;

import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.*;

@RestController
public class GreetingController {
    private GreetingService greetingService;

    @Autowired
    public GreetingController(GreetingService greetingService) {
        this.greetingService = greetingService;
    }

    @GetMapping("/enter")
    public String greeting(@RequestParam String name) {
        return greetingService.getGreeting(name);
    }
}

Sekarang kita sudah boleh test code dengan melayari
localhost:8080/enter?name=Muhammad Ali di browser.
